import React from 'react';
import { Box, Typography, Button } from '@mui/material';
import './App.css';

function App() {
  return (
    <Box
      sx={{
        minHeight: '100vh',
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        justifyContent: 'center',
        background: 'linear-gradient(135deg, #ffeef8 0%, #f8f4ff 100%)',
        padding: 3,
      }}
    >
      <Typography variant="h2" gutterBottom sx={{ fontWeight: 'light', color: 'primary.main' }}>
        Wedding Dress CMS
      </Typography>
      <Typography variant="h5" gutterBottom color="text.secondary">
        Content Management System for Wedding Dress Stores
      </Typography>
      <Button
        variant="contained"
        size="large"
        sx={{
          mt: 3,
          background: 'linear-gradient(135deg, #d4a574 0%, #b8956a 100%)',
          '&:hover': {
            background: 'linear-gradient(135deg, #b8956a 0%, #9d8055 100%)',
          },
        }}
        onClick={() => window.location.href = '/login'}
      >
        Get Started
      </Button>
    </Box>
  );
}

export default App;
